import React, { useState } from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import MainPage from './components/MainPage'; 
import Home from './components/Home'; 
import About from './components/About';
import Resources from './components/Resources'; 
import Favorites from './components/Favorites';
import SignIn from './componentsSignIn';
import SignUp from './SignUp';

const App = () => {
  const [isSignInVisible, setIsSignInVisible] = useState(true);

  return (
    <BrowserRouter>
      <Header />
      <Routes>
        {/* Define your routes using <Route> */}
        <Route path="/" element={<Home />} />
        <Route path="/find-a-pet" element={<MainPage />} />
        <Route path="/about" element={<About />} />
        <Route path="/resources" element={<Resources />} />
        <Route path="/favorites" element={<Favorites />} />
      </Routes>
      <div>
        {isSignInVisible ? <SignIn /> : <SignUp />}
        <button onClick={() => setIsSignInVisible(!isSignInVisible)}>
          {isSignInVisible ? 'Switch to Sign Up' : 'Switch to Sign In'}
        </button>
      </div>
      <Footer />
    </BrowserRouter>
  );
};

export default App;
